import { Component } from 'react';

class Container extends Component {
    state = {
        color: 0
    }

     increment = () => {
        this.setState({
            count: this.state.count + 1
        });
        console.log(this.state.count);
     }

    render(){
        return (
            <div>
                <h1 id="text">My first class component: {this.state.count}</h1>
                <button onClick={this.increment} id="new-quote">GET NEW QUOTE</button>
            </div>
        );
    }
}

export default Container
